import React from "react";

const PaymentHistory = () => {
  return (
    <div>
      <div>
        <table>
          <thead>
            <th>Date and Time</th>
            <th>Amount</th>
            <th>Remark</th>
          </thead>
          <tbody>
            {paymentList.map((payment) => (
              <tr key={payment._id}>
                <td>{payment.createdAt}</td>
                <td>{payment.amount}</td>
                <td>{payment.remark}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default PaymentHistory;
